import { Box } from "@mui/material";
import React, { Component } from "react";
import { Button } from "react-bootstrap";
import "./backBtn.css";

export default function BackButton() {
  return (
    <Box
      style={{
        width: "100vw",
        position: "absolute",
        bottom: "0px",
      }}
    >
      <Button className="backButton" onClick={() => navigateTo("/")}>
        Back
      </Button>
    </Box>
  );
}
